import React, { useState } from 'react';

import Counter from "../Counter";
import DashTile from "./DashTile";
import AlertWidgetH from "./Widgets/AlertWidgetH";



export default function DashTileGroup(props) {
    // Declare a new state variable, which we'll call "count"
    const [count, setCount] = useState(0);

    const elements = ['AAPL', 'GOOG', 'NVDA'];

    const stocks = []

    for (const [index, value] of elements.entries()) {
        stocks.push(<DashTile symbol={value} change="+12%" price="120.00"/>)
    }

    return (
                <div className="m-1 px-1 py-1 rounded-md border-2 border-green-500 text-sm font-medium text-white bg-gray-900 focus:outline-none focus:text-white focus:bg-gray-700">
                    <div className="flex flex-row divide-x gap-x-2">

                        <div>
                            <div>
                                <div className="p-1 text-left font-bold">
                                    {
                                        props.title
                                    }
                                </div>
                                <div className="flex flex-row">
                                    <div className="p-1 text-left font-bold">
                                        +5%
                                    </div>
                                    <div className="p-1 text-left font-bold">
                                        <AlertWidgetH/>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div>
                        <div className=" flex flex-row">
                            <DashTile symbol="AAPL" change="+12%" price="120.00"/>
                            <DashTile symbol="NVDA" change="+12%" price="120.00"/>
                            <DashTile symbol="FB" change="+12%" price="120.00"/>
                            <DashTile symbol="AMZN" change="+12%" price="120.00"/>
                            <DashTile symbol="AMD" change="+12%" price="120.00"/>
                            <DashTile symbol="PINS" change="+12%" price="120.00"/>
                            <DashTile symbol="SNAP" change="+12%" price="120.00"/>

                        </div>
                    </div>
                    </div>
                </div>
    );
}
